import './Event.css';
function Event(props){
  return(

  <div className='train' style={{
    backgroundImage: 'url(${props.photo_icon})'
  }}>or babu
     <div class='train2'>
              <p>
              Artist:-{props.name}
              <br/>
              price: {props.price}<br/>
              date:{props.date}<br/>
              Venue:{props.Location}
              
            </p>
            </div>
            <div className='train1'></div>
  </div>




  );
}      export default Event;
